description:
Mackenna's Gold(1969)

The gangster Colorado kidnaps Marshal McKenna. He believes that McKenna has seen a map which leads to a rich vein of gold in the mountains and forces him to show him the way. But they're not the only ones who're after the gold; soon they meet a group of &quot;honorable&quot; citizens and the cavalry crosses their way too - and that is even before they enter Indian territory.    

